const setUser = (state = {}, action) => {

    switch(action.type) {
        case 'SET_USER':
            var rep = {
                ...state,
                user: action.payload.user
            }
            console.log("Received by user reducer : "+rep);
            return rep;

        default: 
            return state;
    }

}

export default setUser;
